export const mockUsers = [
  {
    id: '1',
    name: 'John Doe',
    email: 'john@example.com',
    role: 'Admin',
    status: 'Active',
  },
  {
    id: '2',
    name: 'Jane Smith',
    email: 'jane@example.com',
    role: 'User',
    status: 'Active',
  },
];

export const mockRoles = [
  {
    id: '1',
    name: 'Admin',
    permissions: ['read_users', 'write_users', 'delete_users', 'read_roles', 'write_roles', 'delete_roles'],
  },
  {
    id: '2',
    name: 'User',
    permissions: ['read_users', 'read_roles'],
  },
];
